import React from 'react';
import classes from "./ClientList.module.css";
import ClientPlate from "../ClientPlate/ClientPlate";
import {useNavigate} from 'react-router-dom'
import Loader from "../../Loader/Loader";

const ClientList = ({Clients, isLoading}) => {
    const router = useNavigate();
    return (
        isLoading
            ?<Loader/>
            :Clients.length === 0
                ?<label>No Hotels</label>
                :<div className={classes.news}>
                {Clients.map((ht)=>
                    <ClientPlate key={ht._id} item={ht} onClick={()=>router(`/client/${ht._id}`)}/>
                )}
            </div>


    );
};

export default ClientList;
